#!/usr/bin/env python
# https://leetcode.com/problems/longest-increasing-subsequence/


class Solution(object):
    def lengthOfLIS(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        size = len(nums)
        if size == 0:
            return size
        m = 0
        result = [1] * size
        for i in range(size):
            for j in range(0, i):
                if nums[j] < nums[i]:
                    result[i] = max(result[j]+1, result[i])
                    if result[i] == m + 1:
                        m = max(m, result[i])
                        break
            m = max(m, result[i])
        return m

